package com.smart.fragment.bean;import java.io.Serializable;public class GongLue implements Serializable {    private String glId;    private String content;    private  String relateJd;    public String getGlId() {        return glId;    }    public void setGlId(String glId) {        this.glId = glId;    }    public String getContent() {        return content;    }    public void setContent(String content) {        this.content = content;    }    public String getRelateJd() {        return relateJd;    }    public void setRelateJd(String relateJd) {        this.relateJd = relateJd;    }}